te',31,'Delete sesion_sub_paquete data:row(31)','2017-02-13 22:35:18'),(1241,1,'190.124.106.190',2,'cliente_historia_clinica',3,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dra. Erika Tatiana Mantilla Orozco\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo.\r\n\r\nTermoterapia, paquete caliente en musculatura de manguito rotador.\r\n\r\nTens nivel sensitivo.\r\n\r\nUltrasonido pulsado con objetivo de reparar tejido lesionado.\r\n\r\nMasaje sedativo dirigido a espasmos musculares.\r\n\r\nAproximaciones y tracciones articulares suaves.\r\nEjercicios de codman.\r\n\r\nTFNP, isometicas alternas y estabilizacion ritmica en cintura escapular y MMSS\',\n  \'diagnostico\' => \'Tendinitis del subraespinoso e infraespinoso\r\nTenosinovitis de la cabeza larga del biceps braquial\r\nArtrosis acromioclavicular\',\n  \'fecha_evaluacion_inicial\' => \'2017-01-30\',\n  \'fecha_evaluacion_final\' => \'2017-02-10\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, de 58 años de edad quien ingresa al servicio con el MSD adosado al cuerpo.  Presenta dolor de 8/10 al movimiento de flexión, abducción y rotación de hombro, presenta espasmos fibras superiores del trapecio bilateral, supraespinoso, infraespinoso y bíceps braquial derecho, disminución del rango de movimiento para la flexión y abd de hombro derecho de 160°, Disminución generalizada de la fuerza de hombro derecho. Presenta patrón de movimiento regular para MSD por disminución del rango de movimiento, de la fuerza y alteración en la funcionalidad. A la evaluación de las pruebas especificas de hombro presenta positivas hawkins y kennedy, maniobra de hobe speed y patte. no se realizan pruebas de longitud muscular por presencia de dolor. Lo anterior altera sus actividades de la vida diaria y su participación en su rol laboral.\',\n  \'evaluacion_final\' => \'Paciente de genero femenino, de 58 años de edad quien ingresa al servicio con el MSD adosado al cuerpo.  Presenta disminucion del dolor de 6/10 al movimiento de flexión, abducción y rotación de hombro, presenta disminucion de espasmos en fibras superiores del trapecio bilateral, supraespinoso, infraespinoso y bíceps braquial derecho, aumento su del rango de movimiento para la flexión y abd de hombro derecho de  0-170° aunque aun presenta dolor a la mitad del rango, Presenta patrón de movimiento regular para MSD por disminución del rango de movimiento, de la fuerza y alteración en la funcionalidad. Lo anterior altera sus actividades de la vida diaria y su participación en su rol laboral.\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-02-14 05:48:44'),(1242,5,'186.144.76.191',2,'sesion_sub_paquete',377,'Update sesion_sub_paquete data:array (\n  \'estado\' => 2,\n  \'fecha_hora_inicio\' => \'(NULl)\',\n  \'fecha_hora_fin\' => \'(NULl)\',\n)','2017-02-14 07:28:00'),(1243,5,'186.144.76.191',2,'sesion_sub_paquete',377,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'3\',\n  \'fecha_hora_inicio\' => \'2017-02-20 06:00:00\',\n  \'fecha_hora_fin\' => \'2017-02-20 07:00:00\',\n  \'fecha_modificacion\' => \'2017-02-14\',\n  \'estado\' => 1,\n)','2017-02-14 07:28:23'),(1244,5,'186.144.76.191',2,'sesion_sub_paquete',378,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'3\',\n  \'fecha_hora_inicio\' => \'2017-02-21 06:00:00\',\n  \'fecha_hora_fin\' => \'2017-02-21 07:00:00\',\n  \'fecha_modificacion\' => \'2017-02-14\',\n  \'estado\' => 1,\n)','2017-02-14 07:28:33'),(1245,5,'186.144.76.191',2,'sesion_sub_paquete',379,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'3\',\n  \'fecha_hora_inicio\' => \'2017-02-23 06:00:00\',\n  \'fecha_hora_fin\' => \'2017-02-23 07:00:00\',\n  \'fecha_modificacion\' => \'2017-02-14\',\n  \'estado\' => 1,\n)','2017-02-14 07:28:56'),(1246,5,'186.144.76.191',2,'sesion_sub_paquete',380,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'3\',\n  \'fecha_hora_ini