hielo.\r\nTermoterapia, paquete caliente.\r\nMasaje sedativo.\r\nEjercicios en CCC asistidos\r\nEjercicios de rango de movimiento pasivos y asistidos.\r\nEjercicios isometricos.\r\n\',\n  \'diagnostico\' => \'Rotura total de musculo supraespinoso izquierdo\r\nTendinitis del musculo infraespinoso izquierdo\r\nTenosinovistis del musculo biceps braquial izquierdo\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-20\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino en buenas condiciones, con antecedentes de cirugia a corazón abierto hace 3 años con implantacion de stent ,quien ingresa al servicio de fisioterapia de manera independiente. A la valoracion inicial la paciente presenta dolor en cara postero-medial del hombro  izquierdo de 8/10 al movimiento de flexión y abd de hombro y a la palpacion, presenta espasmos en fibras supraespinoso, romboideos y deltoides izquierdo, presenta disminucion del rango de movimiento para la flexion y abd de hombre izquierdo de 0-90° por presencia exacerbada de dolor, presenta patron  de movimiento malo para MSI. lo anterior le limita sus actividades de la vida diaria, y le restringe su rol personal y recreativo.\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'5\',\n  \'id_representante\' => \'3\',\n  \'fecha_registro\' => \'2017-02-21 17:37:55\',\n  \'id_cliente\' => \'32\',\n)','2017-02-21 15:37:55'),(1842,5,'186.144.76.191',1,'cliente_historia_clinica',9,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Particular\',\n  \'plan_tratamiento\' => \'crioterapia, masaje con hielo.\r\nTermoterapia, paquete caliente.\r\nTENS, nivel sensitivo. \r\nUltrasonido Pulsado a 1mHz.\r\nmasaje sedativo.\r\nEjercicios Isometricos\r\nTFNP, isometricas alternas y estabilizacion ritmica.\r\nejercicios de rango de movimiento activos y asistidos al final del rango.\r\nTracciones.\r\nEstiramiento mantenido\',\n  \'diagnostico\' => \'Dolor de hombro izquierdo.\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-16\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino en buenas condiciones quien ingresa al servicio de fisioterapia de manera independiente. A la evaluacion fisioterapeutica presenta dolor en hombro derecho de 8/10 al movimiento de flexion y abd de hombro. presenta espasmos en musculo trapecio fibras superiores, romboideos, pectoral mayor y deltroides derecho. presenta limitacion de la movilidad articular de hombro derecho para la flexion y la abd de 0-160° con presencia de dolor al final del rango. presenta patrones de movimientos buenos para MSI. A la exploracion de pruebas especificas de ho,bro presenta positivas hawkins y kenedy, neer, speed, arco doloroso, yegarson, jobe y yocum. lo anterior limita sus actividades de la vida diaria y su participacion en su rol laboral.\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n  \'fecha_registro\' => \'2017-02-21 18:08:21\',\n  \'id_cliente\' => \'31\',\n)','2017-02-21 16:08:21'),(1843,5,'186.144.76.191',2,'sesion_sub_paquete',96,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-02-22\',\n  \'estado\' => 3,\n)','2017-02-22 06:07:39'),(1844,5,'186.144.76.191',2,'sesion_sub_paquete',739,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-02-22\',\n  \'estado\' => 3,\n)','2017-02-22 06:11:13'),(1845,5,'186.144.76.191',2,'sesion_sub_paquete',614,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-02-22\',\n  \'estado\' => 3,\n)','2017-02-22 06:12:14'),(1846,5,'186.144.76.191',2,'cliente_historia_clinica',4,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Eps Ecopetrol\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo en zona lumbar\r\nTermoterapia paquete caliente.\r\nTENS nivel sensitivo.\r\nUltrasonido continuo de 1Hz a 0.5 potencia.\r\nMasaje sedativo en zona lumbar y glutea.\r\nEjercicios de fortalecimiento abdominal en patrones y uniplanares.\r\nTFNP isometricas alternas y estabilizacion ritmica para tronco inferior.\r\nestiramiento mantenido y TFNP como so-R para isquiotibiales.\',\n  \'diagnostico\' => \'Hernia discal L4-L5 y L5- S1.\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-02\',\n  \'fecha_evaluacion_final\' => \'2017-02-09\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino, de 59 años de edad con diagnostico medico de hernia disca de L4-L5 y L5-S1que ingresa al servicio de fisioterapia de manera independiente. presenta dolor en la zona lumbar de 8/10 que le limita a las actividades de ascenso y descenso de escaleras. presenta espasmos en musculatura paravertebral lumbar y gluteos bilateral, retacciones de isquiotibiales de 60° bilateral evaluado con la prueba 90-90 y disminucion de la movilidad de la columna lumbar para la flexion de 2cm de movilidad. Presenta patrones de movimiento regulares de tronco superior e inferior y disminucion de la fuerza abdominal (3). lo anterior le limita las actividades de la vida diaria y su rol laboral.\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-02-22 14:50:46'),(1847,5,'186.144.76.191',2,'sesion_sub_paquete',542,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-02-22\',\n  \'estado\' => 3,\n)','2017-02-22 14:58:56'),(1848,5,'186.144.76.191',2,'persona',35,'Update persona data:array (\n  \'email\' => NULL,\n  \'movil\' => \'3012595439\',\n  \'genero\' => \'2\',\n  \'barrio\' => \'EL PRADO\',\n  \'telefono\' => \'6046522\',\n  \'direccion\' => \'CRA 36 # 41 - 31\',\n  \'foto_perfil\' => \'37791719.jpg\',\n  \'primer_nombre\' => \'FLOR\',\n  \'segundo_nombre\' => \'ELISA\',\n  \'primer_apellido\' => \'MANOSALVA DE ORTEGON\',\n  \'segundo_apellido\' => NULL,\n  \'fecha_nacimiento\' => \'1946-07-14\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\'