o inferior izquierdo teniendo un apoyo unipodal de 10seg en superficie regular. No presenta disminución del rango de movimiento ni de la fuerza muscular. Se encuentran  patrones de movimiento buenos para miembro inferior izquierdo y normales para miembro inferior derecho. No presenta alteración en la funcionalidad pero si limita su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloración el paciente presenta dolor de 2/10 al final del rango de inversión de cuello de pie izquierdo. Se disminuyeron los espasmos en tibial anterior bilateral y gastrocnemios bilateral. No presenta edema en MMII ni signo de fovea . Persiste leve alteración de la propiocepcion y el balance en miembro inferior izquierdo teniendo un apoyo unipodal de 30 seg en superficie inestable (bosu). se conservan rangos de movimiento y fuerza muscular. Los patrones de movimiento son buenos para miembro inferior izquierdo y normales para el derecho. No hay limitación funcional y retomó su actividad deportiva (golf).\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-03-08 08:32:07'),(2567,5,'186.144.76.191',2,'sesion_sub_paquete',926,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-08\',\n  \'estado\' => 3,\n)','2017-03-08 09:57:41'),(2568,5,'186.144.76.191',2,'sesion_sub_paquete',1066,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-08\',\n  \'estado\' => 3,\n)','2017-03-08 09:57:58'),(2569,5,'186.144.76.191',2,'sesion_sub_paquete',990,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-08\',\n  \'estado\' => 3,\n)','2017-03-08 16:29:31'),(2570,5,'186.144.76.191',2,'sesion_sub_paquete',970,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-08\',\n  \'estado\' => 3,\n)','2017-03-08 16:29:41'),(2571,5,'186.144.76.191',2,'sesion_sub_paquete',576,'Update sesion_sub_paquete data:array (\n  \'fecha_modificacion\' => \'2017-03-09\',\n  \'estado\' => 3,\