a de 7 semanas de evolución\',\n  \'fecha_evaluacion_inicial\' => \'2017-02-01\',\n  \'fecha_evaluacion_final\' => \'2017-03-21\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, de 50 años de edad con diagnostico medico de lesiòn de menisco derecho por lo que se le realizò artroscopia el 26 de enero de 2017. Ingresa al servicio de fisioterapia realizando marcha de tres puntos con muletas de manera inadecuada. Presenta dolor en rodilla derecha de 7/10 al reposo y al movimiento de flexión y extensión de rodilla. Edema de 4cm en rodilla respecto al otro miembro y espasmos musculares en cuadriceps femoral, tibial anterior y peroneos bilateral. Disminución del rango de movimiento para la flexiòn de rodilla derecha de 0-90° y  alteración de los patrones de movimiento para miembro inferior derecho siendo malos por restricción en las descargas de peso. Lo anterior la limita en las actividades de la vida diaria y su participación en su rol laboral.\',\n  \'evaluacion_final\' => \'A la revaloración terapéutica después de 32 sesiones de fisioterapia la paciente realiza marcha de forma independiente con todas las fases, subfases y determinantes de la marcha. Presenta dolor en rodilla derecha de 2/10 al reposo y al movimiento de flexión y extensión de rodilla. No presenta edema, pero si espasmos en aductores de cadera bilateral. Se encuentran retracciones musculares del recto anterior del cuadriceps en miembro inferior derecho y retracción de isquiotibiales de forma bilateral. Presenta disminución del rango de movimiento en rodilla derecha de 0-130° con sensación final duro-elástico.  No hay alteración de los patrones de movimiento  pero si leve alteración de la propiocepción y el balance teniendo un apoyo unipodal en superficie inestable (bosu) para miembro inferior derecho de 12s y de 17s para el miembro inferior izquierdo. Lo anterior no le produce alteración de la funcionalidad ni restricción en ninguno de sus roles.\',\n  \'sesiones_realizadas\' => \'32.00\',\n