',\n  \'primer_apellido\' => \'MAESTRE\',\n  \'segundo_apellido\' => \'BADILLO\',\n  \'fecha_nacimiento\' => \'2005-05-06\',\n  \'tipo_identificacion\' => \'1\',\n  \'ciudad\' => \'BUCARAMANGA\',\n  \'numero_identificacion\' => \'1097781963\',\n  \'fecha_registro\' => \'2017-03-31 17:30:30\',\n)','2017-03-31 15:30:30'),(3152,5,'186.144.76.191',1,'usuario',55,'Insert usuario data:array (\n  \'id_persona\' => \'53\',\n  \'fecha_registro\' => \'2017-03-31 17:30:30\',\n  \'password\' => \'1097781963\',\n  \'loggin\' => \'amaestre1\',\n)','2017-03-31 15:30:30'),(3153,5,'186.144.76.191',1,'usuario_perfil_asignado',NULL,'Insert usuario_perfil_asignado data:array (\n  \'id_usuario\' => \'55\',\n  \'id_perfil\' => 2,\n)','2017-03-31 15:30:30'),(3154,5,'186.144.76.191',1,'cliente',50,'Insert cliente data:array (\n  \'eps_prepagada\' => \'COLSANITAS\',\n  \'asistencia_medica\' => NULL,\n  \'emergencia_atencion\' => \'clinicentro\',\n  \'emergencia_pariente_movil\' => \'3163728051\',\n  \'emergencia_pariente_nombre\' => \'MONICA BADILLO MAMA\',\n  \'emergencia_pariente_telefono\' => NULL,\n  \'id_persona\' => \'53\',\n  \'fecha_registro\' => \'2017-03-31 17:30:30\',\n)','2017-03-31 15:30:30'),(3155,6,'190.9.206.196',2,'cliente_historia_clinica',10,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Hugo Alejandro Fernandez\',\n  \'plan_tratamiento\' => \'-Crioterapia, masaje con hielo durante 5 minutos.\r\n\r\n-Tens nivel sensitivo durante 10 minutos.\r\n\r\n-Termoterapia, paquete caliente.\r\n\r\n-Ultrasonido pulsado de 1Hz durante 5 minutos.\r\n\r\n-Masaje sedativo dirigido musculatura con espasmos.\r\n\r\n-TFNP. isometricas alternas y estabilizacion ritmica en posicion de puente y supino con rodillas flexionadas.\r\n\r\n-Sostener relajar para recto anterior del cuadriceps.\r\n\r\n-Estiramiento mantenido.\r\n\r\n\r\n\r\n\r\n\',\n  \'diagnostico\' => \'Tendinitis del glúteo derecho\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-21\',\n  \'fecha_evaluacion_final\' => \'2017-03-31\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración inicial el paciente presenta dolor en cadera derecha de 5/10 a la palpación y de 7/10 al movimiento de flexión y extensión de cadera que le limita al subir y bajar escaleras.  Se palpan espasmos en musculatura pelvitrocanterea, glúteo mayor y medio del lado derecho y se observan retracciones musculares del tensor de la fascia lata y glúteo derecho e isquiotibiales y recto anterior del cuadriceps bilateral. Presenta disminución del rango de movimiento en cadera derecha para la flexión de 0-130° y de rodilla de 0-120° bilateral con sensación final duro-elástico. Presenta patrones de movimiento buenos para miembros inferiores. lo anterior no altera su funcionalidad, pero si restringe su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloración el paciente presenta dolor en cadera derecha de 2/10 a la palpación y de 3/10 al movimiento de flexión y extensión de cadera que le limita al subir y bajar escaleras.  Se disminuyeron espasmos en musculatura pelvitrocanterea, glúteo mayor y medio del lado derecho y mejoras en la longitud muscular del tensor de la fascia lata y glúteo derecho e isquiotibiales y recto anterior del cuadriceps bilateral. se observa aumento del rango de movimiento en cadera derecha para la flexión de 0-140° y de rodilla de 0-130° bilateral con sensación final duro-elástico. Presenta patrones de movimiento buenos para miembros inferiores. lo anterior no altera su funcionalidad, pero si restringe su rol deportivo.\',\n  \'sesiones_realizadas\' => \'9.00\',\n  \'id_representante\' => \'3\',\n)','2017-04-02 17:15:57'),(3156,6,'186.144.76.191',1,'cliente_historia_clinica',12,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr.  Jaime Villamizar \',\n  \'plan_tratamiento\' => \'Crioterapia, Masaje con hielo durante 7 minutos\r\nTermoterapia, paquete caliente durante 10 minutos\r\nTens, nivel sensitivo durante 10 minutos.\r\nTFNP, sostener relajar para isquiotibiales y recto anterior del cuadriceps.\r\nisometricas alternas y estabilización ritmica en posicion de puente.\r\nEjercicios en cadena cinetica cerrada.\r\nEjercicios activos para flexo-extension de cadera y rodilla.\r\nEjercicios con balón de bobath.\',\n  \'diagnostico\' => \'artritis reumatoide.\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-29\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino que ingresa al servicio de fisioterapia realizando marcha antalgica con bastón tradicional. Presenta dolor en rodilla derecha de 5/10 al reposo 2/10 a la palpación y de 8/10 al movimiento de flexo-extensión de rodilla. A la evaluación de la perimetría se corrobora edema de 4cm en rodilla derecha respecto a la izquierda y atrofia generalizada de 1cm  en muslo y pierna derecha. Se observa disminución del rango de movimiento de rodilla de -20° de extensión y de 20°- 120° de flexión con sensación final elástico, para la dorsiflexion de 0-15° y pantiflexión de 0-30° por presencia de edema ademas disminución de la longitud muscular en recto anterior del cuadriceps, isquiotibiales y tensor de la fascia lata de manera bilateral. presenta patrones de movimiento buenos para miembro inferior izquierdo y malos para miembro inferior derecho por disminución generalizada de la fuerza. Lo anterior lo limita en actividades de desplazamientos por trechos cortos, ademas de actividades de ascenso y descenso de escaleras y restringe su rol personal.\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'10\',\n  \'id_representante\' => \'3\',\n  \'fecha_registro\' => \'2017-04-03 08:55:42\',\n  \'id_cliente\' => \'47\',\n)','2017-04-03 06:55:42'),(3157,6,'186.144.76.191',1,'cliente_historia_clinica',13,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Crioterapia. Masaje con hielo durante 10 minutos.\r\nTermoterapia, paquete caliente durante 10 minutos\r\nTens, nivel sensitivo. durante 10 minutos.\r\nMasaje de drenaje y sedativo. \r\nsostener relajar para isquiotibiales y recto anterior del cuadriceps.\r\nEstiramiento mantenido para gastrocnemios y musculatura plantar.\r\n\',\n  \'diagnostico\' => \'Espondilitis calcanea derecha.\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-31\',\n  \'fecha_evaluacion_final\' => \'2017-04-10\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino que ingresa al servicio de fisioterapia de manera independiente realizando marcha antalgica. A la evaluación fisioterapeutica presenta dolor en talón y planta del pie derecho de 1/10 al reposo, de 4/10 a la palpación y de 6/10 movimiento de plantiflexión y dorsiflexión. Se palpan espasmos en musculo tibial anterior derecho y  gastrocnemio de forma bilateral ademas de edema de 1,2 cm de diferencia en talón derecho respecto al talón izquierdo. No se observa disminución del rango de movimiento, sin embargo presenta retracciones musculares en gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. presenta patrones de movimiento normales para miembro inferior izquierdo y regulares para miembro inferior derecho. Lo anterior no limita su funcionalidad pero si restringe su rol deportivo y recreativo.\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'3\',\n  \'fecha_registro\' => \'2017-04-03 09:16:17\',\n  \'id_cliente\' => \'50\',\n)','2017-04-03 07:16:17'),(3158,5,'186.144.76.191',1,'cliente_sub_paquete',100,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-05-03 00:00:00\',\n  \'id_sub_paquete\' => \'10\',\n  \'total_pagar\' => \'360000\',\n  \'id_cliente\' => \'8\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-04-03\',\n  \'fecha_pago\' => \'2017-04-03\',\n)','2017-04-03 07:53:05'),(3159,5,'186.144.76