=> \'34.7\',\n  \'puente_pronto\' => \'22\',\n  \'puente_pronto_clasificacion\' => \'malo\',\n  \'push_up\' => \'6\',\n  \'push_up_rango\' => \'malo\',\n  \'recomendaciones\' => \'VALORACIÓN POSTURA:\r\n- Vista Posterior: leve aumento angulo toracobraquial derecho.\r\n- Visa Lateral: Cabeza adelantada, hombros protruidos, hiperlordosis cervical, hipercifosis dorsal, hiperlordosis lumbar, hiperextensión rodillas, protrusion de  hombros y de abdomen.\r\n- Vista anterior: genu valgo y mayor hiperextensión de rodilla derecha. Pies en eversión.\',\n  \'seat_reach\' => \'-25\',\n  \'seat_reach_clasificacion\' => \'retracciones severas musculatura posterior\',\n  \'talla\' => \'1.69\',\n  \'tecumseh\' => \'39\',\n  \'fecha_registro\' => \'2017-04-04\',\n  \'tecumseh_clasificacion\' => \'excepcional\',\n  \'tension_arterial\' => \'89/51\',\n  \'id_usuario\' => \'5\',\n  \'id_cliente\' => \'46\',\n)','2017-04-04 06:52:53'),(3256,5,'186.144.76.191',2,'cliente_historia_clinica',11,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'- Crioterapia, masaje con hielo durante 5 minutos.\r\n-Tens, nivel sensitivo.\r\n-Masaje de drenaje y sedativo.\r\n-Ejercicios de fortalecimiento con resistencia externa y manual.\r\n-Ejercicios de propiocepcion y balance en colchoneta y bosu.\r\n-Alcances anteriores con balon y cono.\r\n-Ejercicios en Trx.\r\n-Marcha en punta de pies y sobre talones en superficie inestable (colchoneta).\r\n-Sentadillas con Balon de bobath.\r\n-Fortalecimientos de evertores con balón de peso\r\n\',\n  \'diagnostico\' => \'Inestabilidad de tobillo derecho por esguince antiguo\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-21\',\n  \'fecha_evaluacion_final\' => \'2017-03-27\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración fisioterapeutica presenta dolor en maleolo externo de 7/10 al movimiento de inversión del pie, de 7/10 a la palpación y de 5/10 al reposo. Se palpan espasmos en tibial anterior derecho y gastrocnemios bilateral, se evidencia edema en maleolo derecho respecto al izquierdo,  la movilidad articular en cuello de pie e encuentra conservada. Presenta patrones de movimientos buenos para miembro inferior derecho y normales para miembro inferior izquierdo, se observa alteración de la propiocepcion y el balance teniendo en apoyo unipodal derecho 18seg e izquierdo 26seg.  Lo anterior no limita su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'evaluacion_final\' => \'A la revaloracion la paciente presenta dolor en maleolo externo de 3/10 al movimiento de inversión del pie, de 4/10 a la palpación y de 0/10 al reposo. Se disminuyeron espasmos en tibial anterior derecho y persisten en gastrocnemios bilateral, no se evidencia  edema en maleolo derecho y se observa mejora en la propiocepcion y el balance teniendo en apoyo unipodal derecho 41seg e izquierdo 50seg. Demás evaluaciones se encuentran iguales y no se encuentra limitada su funcionalidad pero si restringe su participacion en su rol deportivo.\',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'3\',\n)','2017-04-05 06:58:26'),(3257,5,'186.144.76.191',1,'persona',54,'Insert persona data:array (\n  \'email\' => \'rocis04@hotmail.com\',\n  \'movil\' => \'3123291474\',\n  \'genero\' => \'2\',\n  \'barrio\' => \'SOTOMAYOR\',\n  \'telefono\' => \'6760130\',\n  \'direccion\' => \'CRA 31 N 51-34 APTO 402\',\n  \'foto_perfil\' => \'63339086.jpg\',\n  \'primer_nombre\' => \'ROCIO\',\n  \'segundo_nombre\' => NULL,\n  \'primer_apellido\' => \'LOPEZ\',\n  \'segundo_apellido\' => \'BELTRAN\',\n  \'fecha_nacimiento\' => \'1969-06-10\',\n  \'tipo_identificacion\' => \'2\',\n  \'ciudad\' => \'BUCARAMANGA\',\n  \'numero_identificacion\' => \'63339086\',\n  \'fecha_registro\' => \'2017-04-06 09:12:31\',\n)','2017-04-06 07:12:31'),(3258,5,'186.144.76.191