ha_evaluacion_final\' => \'2017-04-17\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino quien ingresa al servicio de fisioterapia realizando marcha de forma independiente. A  la valoración fisioterapeutica presenta dolor en zona cervical de 8/10 para todos los movimientos de cabeza y cuello, de 6/10 a la palpación y de 5/10 al reposo que le irradia a miembros superiores. Se palpan espasmos en músculos trapecio fibras superiores bilateral y se observa disminución del rango de movimiento para las rotaciones de cabeza de 0-30° hacia la izquierda y para la extensión de cabeza de 0-40°. Presenta patrones de movimiento regulares para cabeza y cuello por disminución del rango de movimiento y fuerza. Presenta limitación en las actividades básicas cotidianas y restricción en su rol laboral.\',\n  \'evaluacion_final\' => \'En la  revaloración fisioterapeutica presenta dolor en zona cervical de 7/10 para todos los movimientos de cabeza y cuello, de 4/10 a la palpación y de 3/10 al reposo que le irradia a miembros superiores. Se palpa disminución de espasmos en músculos trapecio fibras superiores bilateral y se observa mejora del rango de movimiento para las rotaciones de cabeza de 0-40° hacia la izquierda. Presenta patrones de movimiento regulares para cabeza y cuello por disminución del rango de movimiento y fuerza. Presenta limitación en las actividades básicas cotidianas y restricción en su rol laboral.\',\n  \'sesiones_realizadas\' => \'5.00\',\n  \'id_representante\' => \'3\',\n)','2017-04-25 17:22:06'),(3657,6,'190.9.206.194',2,'cliente_historia_clinica',12,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr.  Jaime Villamizar \',\n  \'plan_tratamiento\' => \'Crioterapia, Masaje con hielo durante 7 minutos\r\nTermoterapia, paquete caliente durante 10 minutos\r\nTens, nivel sensitivo durante 10 minutos.\r\nTFNP, sostener relajar para isquiotibiales y recto anterior del cuadriceps.\r\nisometricas alternas y estabilización ritmica en posicion de puente.\r\nEjercicios en cadena cinetica cerrada.\r\nEjercicios activos para flexo-extension de cadera y rodilla.\r\nEjercicios con balón de bobath.\',\n  \'diagnostico\' => \'artritis reumatoide.\',\n  \'fecha_evaluacion_inicial\' => \'2017-03-29\',\n  \'fecha_evaluacion_final\' => \'2017-04-11\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino que ingresa al servicio de fisioterapia realizando marcha antalgica con bastón tradicional. Presenta dolor en rodilla derecha de 5/10 al reposo 2/10 a la palpación y de 8/10 al movimiento de flexo-extensión de rodilla. A la evaluación de la perimetría se corrobora edema de 4cm en rodilla derecha respecto a la izquierda y atrofia generalizada de 1cm  en muslo y pierna derecha. Se observa disminución del rango de movimiento de rodilla de -20° de extensión y de 20°- 120° de flexión con sensación final elástico, para la dorsiflexion de 0-15° y pantiflexión de 0-30° por presencia de edema ademas disminución de la longitud muscular en recto anterior del cuadriceps, isquiotibiales y tensor de la fascia lata de manera bilateral. presenta patrones de movimiento buenos para miembro inferior izquierdo y malos para miembro inferior derecho por disminución generalizada de la fuerza. Lo anterior lo limita en actividades de desplazamientos por trechos cortos, ademas de actividades de ascenso y descenso de escaleras y restringe su rol personal.\',\n  \'evaluacion_final\' => \'En la revaloracion fisioterapeutica  Presenta dolor en rodilla derecha de 2/10 al reposo 0/10 a la palpación y de 6/10 al movimiento de flexo-extensión de rodilla. El edema disminuyó siendo ahora de 2cm en rodilla derecha respecto a la izquierda y atrofia generalizada de 1cm  en muslo y pierna derecha. Se conservó la disminución del rango de movimiento de rodilla de -20° de extensión y de 20°- 120° de flexión con sensación final elástico, para la dorsiflexion de 0-15° y pantiflexión de 0-30° por presencia de edema ademas disminución de la longitud muscular en recto anterior del cuadriceps, isquiotibiales y tensor de la fascia lata de manera bilateral. presenta patrones de movimiento bueno para miembro inferior izquierdo y regular para miembro inferior derecho por disminución generalizada de la fuerza. Lo anterior lo limita en actividades de desplazamientos por trechos cortos, ademas de actividades de ascenso y descenso de escaleras y restringe su rol personal.\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-04-25 17:33:59'),(3658,6,'186.144.76.191',1,'cliente_historia_clinica',15,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo\r\nTens nivel sensitivo\r\nMasaje de drenaje y sedativo.\r\nEstiramiento mantenido.\r\nTFNP, sostener relajar, isometricas alternas y estabilizacion ritmica.\',\n  \'diagnostico\' => \'Tendencia al retropie cavo\r\nOs navicular tipo II, con leve edema en la médula osea navicular, por contusión o incipientes cambios degenerativos.\r\nLesión osteocondral distal del metatarsiano del hallux de origen traumatico o degenerativo. \r\nLeve engrosamiento de la fascia plantar en la inserción por fascitis con cambios inflamatorios profundos e incipiente ruptura lineal intrasustancia de 5mm.\r\ntendinopatia inframaleolar del peroneo corto.\',\n  \'fecha_evaluacion_inicial\' => \'2017-04-25\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'paciente de genero masculino, quien ingresa realizando marcha de manera independiente. A la valoracion fisioterapeutica, se observa tendencia de pie cavo bilateral. Presenta dolor de 8/10 al reposo, de 7/10 a la palpación y de 10/10 al movimiento de subir y bajar escaleras. se observa edema en pie derecho respecto al pie izquierdo, retracciones musculares de plantiflexores y presencia de espasmos en la misma musculatura y planta del pie derecho. presenta disminución del rango de movimiento para la dorsiflexion del pie derecho de 0-10° con sensación final dura patológica. presenta patrones de movimientos buenos para miembros inferiores. Lo anterior no limita su funcionalidad, pero si presenta restricción en la participacion de su rol deportivo. \',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'3\',\n  \'fecha_registro\' => \'2017-04-26 07:40:32\',\n  \'id_cliente\' => \'55\',\n)','2017-04-26 05:40:32'),(3659,5,'186.144.76.191',1,'cliente_sub_paquete',125,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-04-26 00:00:00\',\n  \'id_sub_paquete\' => \'22\',\n  \'total_pagar\' => \'30000\',\n  \'id_cliente\' => \'55\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-04-25\',\n  \'fecha_pago\' => \'2017-04-25\',\n)','2017-04-26 06:16:08'),(3660,5,'186.144.76.191',1,'sesion_sub_paquete',1757,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'125\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-04-26\',\n  \'numero\' => 1,\n)','2017-04-26 06:16:08'),(3661,5,'186.144.76.191',2,'sesion_sub_paquete',1757,'Update sesion_sub_paquete data:array (\n  \'id_representante\' => \'3\',\n  \'fecha_hora_inicio\' => \'2017-04-25 07:00:00\',\n  \'fecha_hora_fin\' => \'2017-04-25 08:00:00\',\n  \'fecha_modificacion\' => \'2017-04-26\',\n  \'estado\' => 1,\n)','2017-04-26 06:16:27'),(3662,5,'186.144.76.191',1,'cliente_sub_paquete',126,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-04-27 00:00:00\',\n  \'id_sub_paquete\' => \'22\',\n  \'total_pagar\' => \'30000\',\n  \'id_cliente\' => \'55\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-04-26\',\n  \'fecha_pago\' => \'2017-04-26\',\n)','2017-04-26 06:17:12'),(3663,5,'186.144.76.191',1,'sesion_sub_paquete',1758,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'126\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-04-26\',\n  \'numero\' => 1,\n)','2017-