erecho de 1/10 al reposo, de 4/10 a la palpación y de 6/10 movimiento de plantiflexión y dorsiflexión. Se palpan espasmos en musculo tibial anterior derecho y  gastrocnemio de forma bilateral ademas de edema de 1,2 cm de diferencia en talón derecho respecto al talón izquierdo. No se observa disminución del rango de movimiento, sin embargo presenta retracciones musculares en gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. presenta patrones de movimiento normales para miembro inferior izquierdo y regulares para miembro inferior derecho. Lo anterior no limita su funcionalidad pero si restringe su rol deportivo y recreativo.\',\n  \'evaluacion_final\' => \' A la revaloracion fisioterapeutica presenta dolor en talón y planta del pie derecho de 1/10 al reposo, de 1/10 a la palpación y de 1/10 movimiento de plantiflexión y dorsiflexión. Se palpa disminucion espasmos en musculo tibial anterior derecho y  gastrocnemio de forma bilateral ademas de disminucion edema de 0.5cm de diferencia en talón derecho respecto al talón izquierdo. Se valora mejoría en la longitud muscular en  gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. Presenta patrones de movimiento normales para miembro inferior izquierdo y buenos para miembro inferior derecho. Lo anterior no limita su funcionalidad ni restringe su rol deportivo y recreativo\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-04-27 16:19:38'),(3929,6,'190.9.206.237',1,'cliente_historia_clinica',16,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'DR. Jhon Freddy Fonseca\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo.\r\nTens nivel sensitivo.\r\nMasaje sedativo y de drenaje.\r\nEjercicios de rango de movimiento asistidos para flexión, extensión y abducción de cadera.\r\nEjercicios de rango de movimiento activos y resistidos para cuadriceps e isquiotibiales.\r\nEjercicios resistidos con theraband para dorsiflexores y plantiflexores.\r\n\',\n  \'diagnostico\' => \'Artroscopia de cadera izquierda con implantación de expansor \',\n  \'fecha_evaluacion_inicial\' => \'2017-04-17\',\n  \'fecha_evaluacion_final\' => \'1969-12-31\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino en buenas condiciones. A la valoración fisioterapeutica presenta dolor de 8/10 al reposo y de 9/10 al movimiento de flexión, extensión abducción de cadera izquierda, no se valora dolor a la palpación, ni a los demás movimientos de cadera. A la evaluación del tejido tegumentario presenta herida quirúrgica suturada de 12cm de extensión en cara lateral de cadera izquierda sin signos de infección, ademas se observa gran edema y hematomas. Se observa disminución del rango de movimiento en cadera izquierda para la flexión de 0-80°, para la extensión de 0-5°, para la abducción de 0-45 con sensación final vacío, ademas disminución de la fuerza en abductores de 3-, extensores 2, flexores 3-,  isquiotibiales 3+ y cuadriceps 3+. Presenta patrones de movimiento normales para miembro inferior derecho y malos para miembro inferior izquierdo, realiza marcha en tres puntos correctamente. todo lo anterior le limita su funcionalidad en actividades básicas cotidianas y restringe su participación en todos sus roles.\',\n  \'evaluacion_final\' => NULL,\n  \'sesiones_realizadas\' => NULL,\n  \'id_representante\' => \'3\',\n  \'fecha_registro\' => \'2017-04-27 18:42:01\',\n  \'id_cliente\' => \'53\',\n)','2017-04-27 16:42:01'),(3930,5,'186.144.76.191',2,'cliente_fisioterapia',11,'Update cliente_fisioterapia data:array (\n  \'frecuencia_cardiaca_inicio\' => \'72\',\n  \'frecuencia_cardiaca_zona_aerobica\' => \'126\',\n  \'frecuencia_respiratoria\' => \'16.00\',\n  \'montgomery_numero_repeticiones\' => \'10.00\',\n  \'montgomery_posicion\' => \'4\',\n  \'montgomery_tiempo\' => \'30\',\n  \'peso\' => \'54.70\',\n  \'porcentaje_grasa\' => \'32.6\',\n  \'porcentaje_musculo\' => \'31.4\',\n  \'puente_pronto\' => \'60.00\',\n  