a data:array (\n  \'frecuencia_cardiaca_inicio\' => \'107\',\n  \'frecuencia_cardiaca_zona_aerobica\' => \'142-152\',\n  \'frecuencia_respiratoria\' => \'20\',\n  \'montgomery_numero_repeticiones\' => \'10\',\n  \'montgomery_posicion\' => \'3\',\n  \'montgomery_tiempo\' => \'30\',\n  \'peso\' => \'66.4\',\n  \'porcentaje_grasa\' => \'35.4\',\n  \'porcentaje_musculo\' => \'30\',\n  \'puente_pronto\' => \'39\',\n  \'puente_pronto_clasificacion\' => \'regular\',\n  \'push_up\' => \'9\',\n  \'push_up_rango\' => \'regular\',\n  \'recomendaciones\' => \'VALORACIÓN POSTURA:\r\n- Vista posterior: ascenso cadera derecha, escoliosis lumbar derecha, \r\n- Vista lateral:cabeza adelantada, hiperlordosis lumbar, leve hiperextensión de rodillas.\r\n-Vista anterior: asecenso hombro izquierdo, posible escoliosis dorsal izquierda , rotación del tronco a la izquierda.\',\n  \'seat_reach\' => \'-21\',\n  \'seat_reach_clasificacion\' => \'retracciones musculatura posterior\',\n  \'talla\' => \'1.60\',\n  \'tecumseh\' => \'60\',\n  \'fecha_registro\' => \'2017-04-29\',\n  \'tecumseh_clasificacion\' => \'malo\',\n  \'tension_arterial\' => \'119/82\',\n  \'id_usuario\' => \'5\',\n  \'id_cliente\' => \'54\',\n)','2017-04-29 11:40:23'),(3939,6,'190.9.206.215',1,'cliente_historia_clinica',17,'Insert cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo,\r\nTermoterapia, paquete caliente\r\nTens, nivel sensitivo\r\nUltrasonido pulsado de 1Hz de intensidad\r\nMasaje de derenaje y sedativo\r\nTFNP, como isometricas alternas y estabilizacion ritmicas en cuello de pie.\r\nReducacion de la marcha con bastón y en banda sin fin.\',\n  \'diagnostico\' => \'Tendinosis distal del aquiles\r\nFascitis plantar\r\nTenosinovistis del flexor del hallux\r\nSindrome de pinzamiento posterior\r\nsinovitis de la articulacion tibio-astragalina, astragalo navicular y calcaneo cuboidea\r\n\',\n  \'fecha_evaluacion_inicial\' => \'2017-04-26\',\n  \'fecha_evaluacion_final\' => \'2017-04-29\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, quien ingresa al servicio de fisioterapia en silla de ruedas acompañada de familiar. A la valoración fisioterapeutica presenta dolor en la planta y en cara medial del pie izquierdo de 6/10 al reposo de 7/10 a la palpación y de 9/10 al movimiento de planti y dorsiflexion. Por medio de perimetria se corrobora edema en pie y tobillo izquierdo de 1cm respecto al derecho y leve edema en hallux, se palpan espasmos en tibial anterior y gastrocnemios aunque no se evidencia disminución del rango de movimiento. Presenta patrones de movimiento normales para miembro inferior derecho y malos para el miembro inferior izquierdo por compromiso de la fuerza, movilidad, funcionalidad y coordinación. lo anterior limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol laboral y recreativo.\',\n  \'evaluacion_final\' => \'A la revaloración fisioterapeutica presenta dolor en la planta y en cara medial del pie izquierdo de 3/10 al reposo de 5/10 a la palpación y de 4/10 al movimiento de planti y dorsiflexion. No presenta edema en pie ni tobillo izquierdo aunque persiste edema en hallux, se palpa disminución de espasmos en tibial anterior y gastrocnemios. se observa alteración en las fases, subfases y determinates de la marcha. Presenta patrones de movimiento normales para miembro inferior derecho y regulares para el miembro inferior izquierdo por compromiso de la movilidad y coordinación. lo anterior no limita su funcionalidad aunque todavía restringe su participación en su rol laboral y recreativo.\',\n  \'sesiones_realizadas\' => \'4.00\',\n  \'id_representante\' => \'3\',\n  \'fecha_registro\' => \'2017-05-02 10:45:09\',\n  \'id_cliente\' => \'57\',\n)','2017-05-02 08:45:09'),(3940,6,'190.9.206.215',2,'cliente_historia_clinica',16,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'DR. Jhon Freddy Fonseca\',\n  \'plan_tratamiento\' => \'Crioterapia, masaje con hielo.\r\nTens nivel sensitivo.\r\nMasaje sedativo y de drenaje.\r\nEjercicios de rango de movimiento asistidos para flexión, extensión y abducción de cadera.\r\nEjercicios de rango de movimiento activos y resistidos para cuadriceps e isquiotibiales.\r\nEjercicios resistidos con theraband para dorsiflexores y plantiflexores.\r\n\',\n  \'diagnostico\' => \'Artroscopia de cadera izquierda con implantación de expansor \',\n  \'fecha_evaluacion_inicial\' => \'2017-04-17\',\n  \'fecha_evaluacion_final\' => \'2017-04-28\',\n  \'evaluacion_inicial\' => \'Paciente de genero masculino en buenas condiciones. A la valoración fisioterapeutica presenta dolor de 8/10 al reposo y de 9/10 al movimiento de flexión, extensión abducción de cadera izquierda, no se valora dolor a la palpación, ni a los demás movimientos de cadera. A la evaluación del tejido tegumentario presenta herida quirúrgica suturada de 12cm de extensión en cara lateral de cadera izquierda sin signos de infección, ademas se observa gran edema y hematomas. Se observa disminución del rango de movimiento en cadera izquierda para la flexión de 0-80°, para la extensión de 0-5°, para la abducción de 0-45 con sensación final vacío, ademas disminución de la fuerza en abductores de 3-, extensores 2, flexores 3-,  isquiotibiales 3+ y cuadriceps 3+. Presenta patrones de movimiento normales para miembro inferior derecho y malos para miembro inferior izquierdo, realiza marcha en tres puntos correctamente. todo lo anterior le limita su funcionalidad en actividades básicas cotidianas y restringe su participación en todos sus roles.\',\n  \'evaluacion_final\' => \'A la revaloración fisioterapeutica presenta dolor de 4/10 al reposo, de 5/10 a la palpación y de 8/10 al movimiento de flexión, extensión abducción de cadera izquierda, aun no se valora dolor a los demás movimientos de cadera. A la evaluación del tejido tegumentario presenta herida quirúrgica sin suturas de 12cm de extensión en cara lateral de cadera izquierda en buen estado de cricartrizacion, ademas se observa disminución del edema y hematomas. presenta mejoras disminución de la fuerza en abductores de cadera con notas de 3,  y extensores con notas de 2+. Presenta patrones de movimiento normales para miembro inferior derecho y malos para miembro inferior izquierdo, realiza marcha en tres puntos correctamente. todo lo anterior le limita su funcionalidad en actividades básicas cotidianas y restringe su participación en todos sus roles.\',\n  \'sesiones_realizadas\' => \'10.00\',\n  \'id_representante\' => \'3\',\n)','2017-05-02 08:55:19'),(3941,5,'186.144.76.191',1,'cliente_sub_paquete',141,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-06-02 00:00:00\',\n  \'id_sub_paquete\' => \'2\',\n  \'total_pagar\' => \'200000\',\n  \'id_cliente\' => \'3\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-05-02\',\n  \'fecha_pago\' => \'2017-05-02\',\n)','2017-05-02 09:02:05'),(3942,5,'186.144.76.191',1,'sesion_sub_paquete',1948,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'141\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-02\',\n  \'numero\' => 1,\n)','2017-05-02 09:02:05'),(3943,5,'186.144.76.191',1,'sesion_sub_paquete',1949,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'141\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-02\',\n  \'numero\' => 2,\n)','2017-05-02 09:02:05'),(3944,5,'186.144.76.191',1,'sesion_sub_paquete',1950,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'141\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-02\',\n  \'numero\' => 3,\n)','2017-05-02 09:02:05'),(3945,5,'186.144.76.191',1,'sesion_sub_paquete',1951,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'141\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-02\',\n  \'numero\' => 4,\n)','2017-05-02 09:02:05'),(3946,5,'186.144.76.