lizadora de tobillo por presentar un esguince de tobillo derecho hace 16 días de evolución, a valoración refiere dolor de 2/10 a palpación al rededor de maléolo derecho, 6/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema moderado al rededor de la articulación tibioperoneoastragalina  derecho de 1,5 cm, atrofia muscular de gastrosoleo derecho, disminución de rangos de movilidad activa a la dorsiflexión de 15°, plantiflexión 25°, inversión de 10°, eversión de 5°, buena fuerza muscular en plantiflexores, dorsiflexores y regular fuerza en evertores e invertores. En Postura vista lateral presenta hiperextensión de rodilla de derecha con pie normal-cavo, marcha antalgica sin muletas, con alteración en la fases de marcha. 5 segundos en equilibrio unipodal derecho.\',\n  \'evaluacion_final\' => \'Paciente que realiza 7 sesiones de terapia física, quien no continúa, por motivo de viaje al exterior, se realiza valoración final, presentando dolor de 2/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema leve al rededor de la articulación tibioperoneoastragalina  derecho de 0,5 cm, leve disminución de rangos de movilidad activa a la  inversión de 20° y eversión de 10°, aumento leve de la masa muscular de gastrosoleo derecho, buena fuerza muscular en plantiflexores, dorsiflexores y buena fuerza en evertores e invertores, marcha sin alteración de sus fases, aumento a 40 segundos en equilibrio unipodal derecho. \',\n  \'sesiones_realizadas\' => \'7.00\',\n  \'id_representante\' => \'4\',\n)','2017-05-23 05:30:26'),(4810,65,'186.144.76.191',2,'cliente_historia_clinica',23,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Criomasaje: Masaje cubo de hielo\r\nUltrasonido, pulsátil y continuo\r\nTENS, \r\nTermoterapia: Paquete caliente \r\nMasaje de drenaje y sedación \r\nEntrenamiento de marcha sobre colchoneta, step y banda sin fin, \r\nEntrenamiento funcional para equilibrio y postura en trampolín y bosú, con sus progresiones y alcances laterales y frontales\r\nEntrenamiento con TRX. \r\nUso de Therabands, escalerilla, \',\n  \'diagnostico\' => \'Esguince de tobillo derecho\',\n  \'fecha_evaluacion_inicial\' => \'2017-05-10\',\n  \'fecha_evaluacion_final\' => \'2017-05-18\',\n  \'evaluacion_inicial\' => \'Paciente masculino de 35 años de edad, quien llega al consultorio en muletas sin hacer apoyo de pie derecho, el cual porta bota inmovilizadora de tobillo por presentar un esguince de tobillo derecho hace 16 días de evolución, a valoración refiere dolor de 2/10 a palpación al rededor de maléolo derecho, 6/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema moderado al rededor de la articulación tibioperoneoastragalina  derecho de 1,5 cm, atrofia muscular de gastrosoleo derecho, disminución de rangos de movilidad activa a la dorsiflexión de 15°, plantiflexión 25°, inversión de 10°, eversión de 5°, buena fuerza muscular en plantiflexores, dorsiflexores y regular fuerza en evertores e invertores. En Postura vista lateral presenta hiperextensión de rodilla de derecha con pie normal-cavo, marcha antalgica sin muletas, con alteración en la fases de marcha. 5 segundos en equilibrio unipodal derecho.\',\n  \'evaluacion_final\' => \'Paciente que realiza 7 sesiones de terapia física, quien no continúa, por motivo de viaje al exterior, se realiza valoración final, presentando dolor de 2/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema leve al rededor de la articulación tibioperoneoastragalina  derecho de 0,5 cm, leve disminución de rangos de movilidad activa a la  inversión de 20° y eversión de 10°, aumento leve de la masa muscular de gastrosoleo derecho, buena fuerza muscular en plantiflexores, dorsiflexores y buena fuerza en evertores e invertores, marcha sin alteración de sus fases, aumento a 40 segundos en equilibrio unipodal derecho. \',\n  \'sesiones_realiz