 y sedativo\r\nTFNP, como isométricas alternas y estabilización ritmicas en cuello de pie.\r\nReeducación de la marcha  en banda sin fin.\r\nReeducación de propiocepción en colchoneta \',\n  \'diagnostico\' => \'Tendinosis distal del aquiles\r\nFascitis plantar\r\nTenosinovistis del flexor del hallux\r\nSindrome de pinzamiento posterior\r\nsinovitis de la articulacion tibio-astragalina, astragalo navicular y calcaneo cuboidea\r\n\',\n  \'fecha_evaluacion_inicial\' => \'2017-04-26\',\n  \'fecha_evaluacion_final\' => \'2017-05-23\',\n  \'evaluacion_inicial\' => \'Paciente de genero femenino, quien ingresa al servicio de fisioterapia en silla de ruedas acompañada de familiar. A la valoración inicial presenta dolor en la planta y en cara medial del pie izquierdo de 6/10 al reposo de 7/10 a la palpación y de 9/10 al movimiento de plantiflexión y dorsiflexión. Por medio de perimetría se corrobora edema en pie y tobillo izquierdo de 1cm respecto al derecho y leve edema en hallux, se palpan espasmos en tibial anterior y gastrocnemios aunque no se evidencia disminución del rango de movimiento. Presenta patrones de movimiento normales para miembro inferior derecho y malos para el miembro inferior izquierdo por compromiso de la fuerza, movilidad, funcionalidad y coordinación. lo anterior limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol laboral y recreativo.\',\n  \'evaluacion_final\' => \'A la evaluación final presenta dolor en cara dorsal del pie izquierdo de 4/10 al reposo de 4/10 a la palpación  y de 2/10 al movimiento de plantiflexión y dorsiflexión. No presenta edema en pie ni tobillo izquierdo, se palpa disminución de espasmos en tibial anterior y gastrocnemios. Se observa alteración en las fases, subfases y determinates de la marcha. Presenta patrones de movimiento normales para miembro inferior derecho y miembro inferior izquierdo, aunque presenta retracciones bilaterales moderadas en musculatura de isquiotibiales, aun persiste alteración de propiocepción y coordinación. Lo anterior no limita su funcionalidad ni participación en su rol laboral y recreativo.\r\nNota: el día 22 de Mayo de 2017 la paciente manifiesta haber asistido a cita con \"sobandero\".\r\nNo realizo las terapias de manera continua y solo llevo a cabo 7 de las 15 sesiones solicitadas \',\n  \'sesiones_realizadas\' => \'7.00\',\n  \'id_representante\' => \'4\',\n)','2017-05-23 16:11:57'),(4839,5,'186.144.76.191',1,'cliente_sub_paquete',178,'Insert cliente_sub_paquete data:array (\n  \'fecha_limite\' => \'2017-06-24 00:00:00\',\n  \'id_sub_paquete\' => \'2\',\n  \'total_pagar\' => \'200000\',\n  \'id_cliente\' => \'38\',\n  \'descuento\' => \'0\',\n  \'fecha_inicio\' => \'2017-05-24\',\n  \'fecha_pago\' => \'2017-05-22\',\n)','2017-05-24 08:51:40'),(4840,5,'186.144.76.191',1,'sesion_sub_paquete',2289,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'178\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-24\',\n  \'numero\' => 1,\n)','2017-05-24 08:51:40'),(4841,5,'186.144.76.191',1,'sesion_sub_paquete',2290,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'178\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-24\',\n  \'numero\' => 2,\n)','2017-05-24 08:51:40'),(4842,5,'186.144.76.191',1,'sesion_sub_paquete',2291,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'178\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-24\',\n  \'numero\' => 3,\n)','2017-05-24 08:51:40'),(4843,5,'186.144.76.191',1,'sesion_sub_paquete',2292,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'178\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-24\',\n  \'numero\' => 4,\n)','2017-05-24 08:51:40'),(4844,5,'186.144.76.191',1,'sesion_sub_paquete',2293,'Insert sesion_sub_paquete data:array (\n  \'id_cliente_sub_paquete\' => \'178\',\n  \'estado\' => 2,\n  \'fecha_registro\' => \'2017-05-24\',\n  \'numero\' => 5,\n)',