'Pinzamiento lateral de tobillo\',\n  \'fecha_evaluacion_inicial\' => \'2017-05-09\',\n  \'fecha_evaluacion_final\' => \'2017-06-01\',\n  \'evaluacion_inicial\' => \'paciente de 27 años de edad con diagnostico ya mencionado, con 3 meses de evolución, con antecedentes de lesión similar previa hace 6 meses, pie plano e hiperextensión de rodillas.de  Escala análoga del dolor: 2/10 al reposo, 8/10  al movimiento, 8/10 a la presión submaleolar externa y dorso de los metatarsos, maléolo externo borrado por edema, marcha antálgica con cojera izquierda, edema de cuello de pie de 2 cm de diámetro con respecto a maléolo contralateral, flexión plantar de 12°, flexión dorsal de 20°, inversión 5° y eversión 12°, disminución de fuerza muscular en evertores por el edema.\',\n  \'evaluacion_final\' => \'Paciente que finaliza sus 15 sesiones de fisioterapia. Escala análoga del dolor 2/10 al reposo, 4/10 al movimiento activo, 3/10 a la presión en el tendón tibial anterior , 7/10 a la palpación supramaleolar externa, 5/10 submaleolar externa, sin edema, con marcha sin antalgia, flexión plantar 20°, flexión dorsal 33°, inversión 33°, eversión 32°, fuerza muscular de 5/5. No le impide el rol en sus actividades laborales ni de la vida diaria (caminar, trotar) y se le restringe practicar el patinaje por aparición del dolor a la activad extenuante.\',\n  \'sesiones_realizadas\' => \'15.00\',\n  \'id_representante\' => \'5\',\n)','2017-06-05 16:05:26'),(5102,65,'181.174.28.41',2,'cliente_historia_clinica',23,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Criomasaje: Masaje cubo de hielo\r\nUltrasonido, pulsátil y continuo\r\nTENS, \r\nTermoterapia: Paquete caliente \r\nMasaje de drenaje y sedación \r\nEntrenamiento de marcha sobre colchoneta, step y banda sin fin, \r\nEntrenamiento funcional para equilibrio y postura en trampolín y bosú, con sus progresiones y alcances laterales y frontales\r\nEntrenamiento con TRX. \r\nUso de Therabands, escalerilla, \',\n  \'diagnostico\' => \'Esguince de tobillo derecho\',\n  \'fecha_evaluacion_inicial\' => \'2017-05-10\',\n  \'fecha_evaluacion_final\' => \'2017-05-18\',\n  \'evaluacion_inicial\' => \'Paciente masculino de 35 años de edad, quien llega al consultorio en muletas sin hacer apoyo de pie derecho, el cual porta bota inmovilizadora de tobillo por presentar un esguince de tobillo derecho hace 16 días de evolución, a valoración refiere dolor de 2/10 a palpación al rededor de maléolo derecho, 6/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema moderado al rededor de la articulación tibioperoneoastragalina  derecho de 1,5 cm, atrofia muscular de gastrosoleo derecho, disminución de rangos de movilidad activa a la dorsiflexión de 15°, plantiflexión 25°, inversión de 10°, eversión de 5°, buena fuerza muscular en plantiflexores, dorsiflexores y regular fuerza en evertores e invertores. En Postura vista lateral presenta hiperextensión de rodilla de derecha, descenso del apoyo plantar, marcha antalgica sin muletas, con alteración en la fases de marcha, alteración en la coordinación y propiocepción en miembros inferiores , registrando 5 segundos en equilibrio unipodal derecho.  lo anterior limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol y recreativo.\',\n  \'evaluacion_final\' => \'Paciente que realiza 7 sesiones de terapia física, quien no continúa, por motivo de viaje al exterior, se realiza valoración final, presentando dolor de 2/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema leve al rededor de la articulación tibioperoneoastragalina  derecho de 0,5 cm, leve disminución de rangos de movilidad activa a la  inversión de 20° y eversión de 10°, , buena fuerza muscular en plantiflexores, dorsiflexores y buena fuerza en evertores e invertores, marcha sin alteración de sus fases, mejoro coordinación y propiocepción en miembros inferiores, registro  aumento a 40 segundos en equilibrio unipodal derecho.  Lo anterior no limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol laboral. \',\n  \'sesiones_realizadas\' => \'7.00\',\n  \'id_representante\' => \'4\',\n)','2017-06-05 16:23:42'),(5103,65,'181.174.28.41',2,'cliente_historia_clinica',23,'Update cliente_historia_clinica data:array (\n  \'remitido_por\' => \'Dr. Juan Camilo Mantilla\',\n  \'plan_tratamiento\' => \'Criomasaje: Masaje cubo de hielo\r\nUltrasonido, pulsátil y continuo\r\nTENS, \r\nTermoterapia: Paquete caliente \r\nMasaje de drenaje y sedación \r\nEntrenamiento de marcha sobre colchoneta, step y banda sin fin, \r\nEntrenamiento funcional para equilibrio y postura en trampolín y bosú, con sus progresiones y alcances laterales y frontales\r\nEntrenamiento con TRX. \r\nUso de Therabands, escalerilla, \',\n  \'diagnostico\' => \'Esguince de tobillo derecho\',\n  \'fecha_evaluacion_inicial\' => \'2017-05-10\',\n  \'fecha_evaluacion_final\' => \'2017-05-18\',\n  \'evaluacion_inicial\' => \'Paciente masculino de 35 años de edad, quien llega al consultorio en muletas sin hacer apoyo de pie derecho, el cual porta bota inmovilizadora  por presentar un esguince de tobillo derecho hace 16 días de evolución, a valoración refiere dolor de 2/10 a palpación al rededor de maléolo derecho, 6/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema moderado al rededor de la articulación tibioperoneoastragalina  derecho, se corrobora con perimetría registrando  1,5 cm, atrofia muscular de gastrosoleo derecho, disminución de rangos de movilidad activa a la dorsiflexión de 15°, plantiflexión 25°, inversión de 10°, eversión de 5°, buena fuerza muscular en plantiflexores, dorsiflexores y regular fuerza en evertores e invertores. En Postura vista lateral presenta hiperextensión de rodilla de derecha, descenso del apoyo plantar, marcha antalgica sin muletas, con alteración en la fases de ma