/*Table structure for table `cliente` */

DROP TABLE IF EXISTS `cliente`;

CREATE TABLE `cliente` (
  `id_cliente` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id del cliente',
  `id_persona` int(11) unsigned NOT NULL COMMENT 'Id de la persona',
  `eps_prepagada` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Eps prepagada',
  `asistencia_medica` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Asistencia médica',
  `emergencia_atencion` mediumtext COLLATE utf8_unicode_ci COMMENT 'En caso de emergencia es atendido en',
  `emergencia_pariente_nombre` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Nombre del pariente caso emergencia',
  `emergencia_pariente_telefono` varchar(12) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Teléfono del pariente caso emergencia',
  `emergencia_pariente_movil` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Móvil del pariente caso emergencia',
  `observacion` text COLLATE utf8_unicode_ci COMMENT 'Observación acerca del cliente',
  `fecha_registro` datetime NOT NULL COMMENT 'Fecha de registro del cliente',
  PRIMARY KEY (`id_cliente`),
  KEY `id_persona_cliente_idx` (`id_persona`),
  CONSTRAINT `id_persona_cliente_fk` FOREIGN KEY (`id_persona`) REFERENCES `persona` (`id_persona`) ON DELETE NO ACTION ON UPDATE NO ACTION
