/*Table structure for table `cliente_antecedente` */

DROP TABLE IF EXISTS `cliente_antecedente`;

CREATE TABLE `cliente_antecedente` (
  `id_cliente` int(11) unsigned NOT NULL COMMENT 'Id del cliente',
  `id_antecedente` int(11) unsigned NOT NULL COMMENT 'Id del antecedente',
  PRIMARY KEY (`id_cliente`,`id_antecedente`),
  KEY `id_cliente_cliente_antecedente_idx` (`id_cliente`),
  KEY `id_antecedente_cliente_antecedente_idx` (`id_antecedente`),
  CONSTRAINT `id_antecedente_cliente_antecedente_fk` FOREIGN KEY (`id_antecedente`) REFERENCES `antecedente` (`id_antecedente`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `id_cliente_cliente_antecedente_fk` FOREIGN KEY (`id_cliente`) REFERENCES `cliente` (`id_cliente`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

