/*Table structure for table `cliente_fisioterapia` */

DROP TABLE IF EXISTS `cliente_fisioterapia`;

CREATE TABLE `cliente_fisioterapia` (
  `id_cliente_fisioterapia` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id de la tabla',
  `id_cliente` int(11) unsigned NOT NULL COMMENT 'Id del cliente',
  `fecha_registro` date NOT NULL COMMENT 'Fecha de registro',
  `tension_arterial` text COLLATE utf8_unicode_ci COMMENT 'Tensión arterial',
  `frecuencia_cardiaca_inicio` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Frecuencia cardiaca inicial',
  `frecuencia_respiratoria` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Frecuencia respiratoria',
  `talla` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Talla del cliente',
  `peso` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Peso del cliente',
  `porcentaje_grasa` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Porcentaje de grasa',
  `porcentaje_musculo` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Porcentaje del músculo',
  `tecumseh` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Tecumseh (step)',
  `tecumseh_clasificacion` text COLLATE utf8_unicode_ci COMMENT 'clasificacion tecumseh',
  `seat_reach` decimal(5,2) DEFAULT NULL COMMENT 'Seat y reach permite valores negativos',
  `seat_reach_clasificacion` text COLLATE utf8_unicode_ci COMMENT 'clasificacion seat and reach',
  `montgomery_numero_repeticiones` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Montgomery',
  `montgomery_posicion` text COLLATE utf8_unicode_ci COMMENT 'pocision de prueba',
  `montgomery_tiempo` smallint(2) unsigned DEFAULT NULL COMMENT 'tiempo de resistencia',
  `push_up` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Push up',
  `push_up_rango` text COLLATE utf8_unicode_ci COMMENT 'rango de pusp up',
  `puente_pronto` decimal(5,2) unsigned DEFAULT NULL COMMENT 'Puente pronto',
  `puente_pronto_clasificacion` text COLLATE utf8_unicode_ci COMMENT 'clasificacion en puente pronto',
  `frecuencia_cardiaca_zona_aerobica` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Frecuencia zona aerobica',
  `recomendaciones` text COLLATE utf8_unicode_ci COMMENT 'Recomendaciones',
  `id_usuario` int(11) unsigned NOT NULL COMMENT 'id del usuario que registra',
  PRIMARY KEY (`id_cliente_fisioterapia`),
  KEY `id_cliente_fisioterapia_idx` (`id_cliente`),
  CONSTRAINT `id_cliente_fisioterapia_fk` FOREIGN KEY (`id_cliente`) REFERENCES `cliente` (`id_cliente`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `cliente_fisioterapia` */

insert  into `cliente_fisioterapia`(`id_cliente_fisioterapia`,`id_cliente`,`fecha_registro`,`tension_arterial`,`frecuencia_cardiaca_inicio`,`frecuencia_respiratoria`,`talla`,`peso`,`porcentaje_grasa`,`porcentaje_musculo`,`tecumseh`,`tecumseh_clasificacion`,`seat_reach`,`seat_reach_clasificacion`,`montgomery_numero_repeticiones`,`montgomery_posicion`,`montgomery_tiempo`,`push_up`,`push_up_rango`,`puente_pronto`,`puente_pronto_clasificacion`,`frecuencia_cardiaca_zona_aerobica`,`recomendaciones`,`id_usuario`) values (1,9,'2017-01-24','90/67 mmHg','83.00',20.00,1.79,74.90,18.10,38.70,48.00,'suficiente',-14.00,'retracciones',10.00,'5',30,14.00,'excelente',60.00,'bien','132-142','POSTURA: \r\nvista posterior: descenso hombro derecho. tibias varas. escoliosis dorsal izquierda.\r\nvista lateral: hiperlordosis lumbar. protrusion de hombros, protrusión abdominal. hiperextensión de rodillas.\r\nVista Anterior: aumento angulo toracobraquial derecho. leve elevación de cadera derecha. Genu varo predominante en pierna derecha.\r\nMarcha típica con adelanto del centro de gravedad. Percibe más lento su hemicuerpo izquierdo.',0),(2,1,'2017-01-24','129/90 mmhg','74.00',20.00,1.54,70.80,44.20,25.90,51.00,'suficiente',-11.00,'retracciones',10.00,'4',7,NULL,'no aplica',NULL,'no aplica','94-110','POSTURA:\r\nVista posterior: Descenso hombro izquierdo, ascenso cadera derecha, posible escoliosis dorsal izquierda y lumbar derecha, rotación de tronco superior a la izquierda.\r\nVista lateral: hiperlordosis cervical, hipercifosis dorsal, hiperlordosis lumbar, protrusion de hombros.\r\nVista anterior: Leve genu varo predominante en pierna izquierda. rotación externa de cadera izquierda. Pies planos predominio izquierdo.',0),(3,7,'2017-02-15',NULL,'145-58',NULL,1.85,80.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'145-96',NULL,0),(4,5,'2016-12-20','116/69 mmhg','88 ppm',18.00,1.58,61.20,27.80,36.30,44.00,'buena',-2.00,'retracciones leves',10.00,'4',30,11.00,'bueno',42.00,N