corrida de la temporada taurina en la capital.\r\n\r\nLa emergencia es atendida por las estaciones de Bomberos del Centro Histórico y por la Secretaría de Salud. Las autoridades acordonaron la zona y evacuaron a los heridos.',3),(6,29,'2017-02-19 21:36:35','Particular',5,'2017-02-10','Paciente de genero masculino, quien ingresa al servicio de fisioterapia realizando marcha en muletas. presenta dolor en zona lateral de la rodilla de 8/10 al movimiento de flexión de rodilla. presenta espasmos en aductores de cadera bilateral y tibial derecho. presenta edema de 2cm en rodilla derecha respecto a rodilla izquierda sin signo de fovea. No presenta alteración de la sensibilidad. A la valoración de la movilidad articular presenta movilidad de 0-70° de flexión de rodilla derecha y dorsiflexion de -30°. Disminución de la fuerza en MID; en cuadriceps de 2 y demás musculatura notas de -3. presenta patrones de movimiento buenos para MII y malos para MID. Lo anterior le altera las actividades de la vida diaria y  limita su rol laboral y personal.','Crioterapia, masaje con hielo.\r\nTENS, nivel sensitivo.\r\nTermoterapia paquete caliente.\r\nMasaje de drenaje y sedativo.\r\nEjercicios de rango de movimiento asistido en diagonales y uniplanar\r\nTFNP. So-R dirigido a cuadriceps derecho.\r\nIsometricas alternas y estibilizacion ritimica\r\nEjercicios en cadena cinetica frenada\r\nEstiramiento pasivo.\r\n','Fractura de femur izquierdo','2017-02-16','Paciente de genero masculino, quien a la revaloracion presenta disminucion del dolor en zona lateral de la rodilla de 7/10 al movimiento de flexión de rodilla. presenta disminucion de espasmos en aductores de cadera bilateral y tibial derecho. Presenta disminución del edema de 1,5cm en rodilla derecha respecto a rodilla izquierda sin signo de fovea. A la revaloración de la movilidad articular presenta movilidad de 0-80° de flexión de rodilla derecha y dorsiflexion de -30°. presenta patrones de movimiento buenos para MII y malos para MID. Lo anterior le altera las actividades de la vida diaria y  limita su rol laboral y personal',3),(7,30,'2017-02-19 21:49:47','Particular',10,'2017-02-14','Paciente de genero masculino, quien ingresa de manera independiente al servicio de fisioterapia. A la valoración el paciente presenta dolor de 5/10 al final del rango de inversión de cuello de pie izquierdo. Presenta espasmos en tibial anterior bilateral y gastrocnemios bilateral. Edema a nivel de maléolo lateral izquierdo de 2cm respecto al derecho evaluado con perimetria. Presenta alteración de la propiocepcion y el balance en miembro inferior izquierdo teniendo un apoyo unipodal de 10seg en superficie regular. No presenta disminución del rango de movimiento ni de la fuerza muscular. Se encuentran  patrones de movimiento buenos para miembro inferior izquierdo y normales para miembro inferior derecho. No presenta alteración en la funcionalidad pero si limita su rol deportivo.','Crioterapia, masaje con hielo.\r\nTENS, nivel sensitivo.\r\nUltrasonido, pulsado nivel 6 durante 5 minutos.\r\nMasaje de drenaje y sedativo.\r\nEjercicios de fortalecimiento muscular.\r\nEjercicios de estimulacion propioceptiva en bases inestables como bosu\r\nTRX enfatizado en apoyo y propiocepción.\r\nEstiramiento mantenido.\r\n','Esguince de cuello de pie izquierdo de 8 semanas de evolución.','2017-03-02','A la revaloración el paciente presenta dolor de 2/10 al final del rango de inversión de cuello de pie izquierdo. Se disminuyeron los espasmos en tibial anterior bilateral y gastrocnemios bilateral. No presenta edema en MMII ni signo de fovea . Persiste leve alteración de la propiocepcion y el balance en miembro inferior izquierdo teniendo un apoyo unipodal de 30 seg en superficie inestable (bosu). se conservan rangos de movimiento y fuerza muscular. Los patrones de movimiento son buenos para miembro inferior izquierdo y normales para el derecho. No hay limitación funcional y retomó su actividad deportiva (golf).',3),(8,32,'2017-02-21 17:37:55','Dr.  Jaime Villamizar ',5,'2017-02-20','Paciente de genero femenino en buenas condiciones, con antecedentes de cirugia a corazón abierto hace 3 años con implantacion de stent ,quien ingresa al servicio de fisioterapia de manera independiente. A la valoracion inicial la paciente presenta dolor en cara postero-medial del hombro  izquierdo de 8/10 al movimiento de flexión y abd de hombro y a la palpacion, presenta espasmos en fibras supraespinoso, romboideos y deltoides izquierdo, presenta disminucion del rango de movimiento para la flexion 0 -90°,abd 0-70° y rotaciones de 0-30° con de hombro izquierdo todos con sensacion final vacio, presenta patrón  de movimiento malo para MSI. No se realizan pruebas especificas de hombro por presencia exacerbada de dolor. Todo lo anterior le limita sus actividades de la vida diaria, y le restringe su rol personal y recreativo.','Por antecedentes de cirugia cardiaca e implantacion de stent no se hace uso de ultrasonido ni TENS.\r\n\r\nCrioterapia, masaje con hielo.\r\nTermoterapia, paquete caliente.\r\nMasaje sedativo.\r\nEjercicios en CCC asistidos\r\nEjercicios de rango de movimiento pasivos y asistidos.\r\nEjercicios isometricos.\r\n','Rotura total de musculo supraespinoso izquierdo\r\nTendinitis del musculo infraespinoso izquierdo\r\nTenosinovistis del musculo biceps braquial izquierdo','2017-02-24','A la revaloracion la paciente presenta dolor en cara postero-medial del hombro  izquierdo de 6/10 al movimiento de flexión y abd de hombro y a la palpación, presenta disminución de espasmos en fibras supraespinoso, romboideos y deltoides izquierdo, presenta aumento en el rango de movimiento para la flexión 0 -140°,abd 0-120° y rotaciones para la rotación interna de 0-60°, sigue presentando disminución para la rotación externa de 0-30° con sensación final vacío, presenta patrón  de movimiento malo para MSI. A la valoración muscular presenta contracciones débiles para todos los grupos musculares del hombro y contracciones fuertes para flexores y extensores de codo izquierdo.\r\nTodo lo anterior le sigue limitando sus actividades de la vida diaria, y le restringe su rol personal y recreativo.',3),(9,31,'2017-02-21 18:08:21','Particular',10,'2017-02-16','Paciente de genero masculino en buenas condiciones quien ingresa al servicio de fisioterapia de manera independiente. A la evaluación fisioterapeutica presenta dolor en hombro derecho de 8/10 al movimiento de flexión y abd de hombro. presenta espasmos en musculo trapecio fibras superiores, romboides, pectoral mayor y deltoides derecho.Presenta retracciones en musculo pectoral mayor y menor bilateral y limitación de la movilidad articular de hombro derecho para la flexión y la abd de 0-160° con sensación final vacío. presenta patrones de movimientos buenos para MSD y normales para MSI. A la exploración de pruebas especificas de hombro presenta positivas hawkins y kennedy, neer, speed, arco doloroso, yegarson, jobe y yocum. lo anterior limita sus actividades de la vida diaria y su participación en su rol laboral.','crioterapia, masaje con hielo.\r\nTermoterapia, paquete caliente.\r\nTENS, nivel sensitivo. \r\nUltrasonido Pulsado a 1mHz.\r\nmasaje sedativo.\r\ndeslizamiento neural\r\nEjercicios Isometricos\r\nTFNP, isometricas alternas y estabilizacion ritmica.\r\nejercicios de rango de movimiento activos y asistidos al final del rango.\r\nTracciones.\r\nEstiramiento mantenido','Dolor de hombro izquierdo.','2017-02-03','A la revaloración no presenta disminución de dolor en hombro derecho al movimiento de flexión y abd de hombro. Presenta disminución de espasmos en musculo trapecio fibras superiores, romboides, pectoral mayor derecho y aun presenta en deltoides derecho. Presenta disminución de retracciones en pectorales y aun presenta limitación de movilidad articular de hombro derecho para la flexión y la abd de 0-160° con sensación final vacío. presenta patrones de movimientos buenos para MSD. A la exploración de pruebas especificas de hombro presenta positivas hawkins y kenedy, neer, speed, arco doloroso, jobe, negativas yegarson y yocum. lo anterior limita sus actividades de la vida diaria y su participación en su rol laboral.',3),(10,41,'2017-03-22 09:03:03','Dr. Hugo Alejandro Fernandez',9,'2017-03-21','Paciente de genero masculino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración inicial el paciente presenta dolor en cadera derecha de 5/10 a la palpación y de 7/10 al movimiento de flexión y extensión de cadera que le limita al subir y bajar escaleras.  Se palpan espasmos en musculatura pelvitrocanterea, glúteo mayor y medio del lado derecho y se observan retracciones musculares del tensor de la fascia lata y glúteo derecho e isquiotibiales y recto anterior del cuadriceps bilateral. Presenta disminución del rango de movimiento en cadera derecha para la flexión de 0-130° y de rodilla de 0-120° bilateral con sensación final duro-elástico. Presenta patrones de movimiento buenos para miembros inferiores. lo anterior no altera su funcionalidad, pero si restringe su rol deportivo.','-Crioterapia, masaje con hielo durante 5 minutos.\r\n\r\n-Tens nivel sensitivo durante 10 minutos.\r\n\r\n-Termoterapia, paquete caliente.\r\n\r\n-Ultrasonido pulsado de 1Hz durante 5 minutos.\r\n\r\n-Masaje sedativo dirigido musculatura con espasmos.\r\n\r\n-TFNP. isometricas alternas y estabilizacion ritmica en posicion de puente y supino con rodillas flexionadas.\r\n\r\n-Sostener relajar para recto anterior del cuadriceps.\r\n\r\n-Estiramiento mantenido.\r\n\r\n\r\n\r\n\r\n','Tendinitis del glúteo derecho','2017-03-31','A la revaloración el paciente presenta dolor en cadera derecha de 2/10 a la palpación y de 3/10 al movimiento de flexión y extensión de cadera que le limita al subir y bajar escaleras.  Se disminuyeron espasmos en musculatura pelvitrocanterea, glúteo mayor y medio del lado derecho y mejoras en la longitud muscular del tensor de la fascia lata y glúteo derecho e isquiotibiales y recto anterior del cuadriceps bilateral. se observa aumento del rango de movimiento en cadera derecha para la flexión de 0-140° y de rodilla de 0-130° bilateral con sensación final duro-elástico. Presenta patrones de movimiento buenos para miembros inferiores. lo anterior no altera su funcionalidad, pero si restringe su rol deportivo.',3),(11,42,'2017-03-23 18:19:06','Dr. Juan Camilo Mantilla',5,'2017-03-21','Paciente de genero femenino que ingresa al servicio de fisioterapia realizando marcha de manera independiente. A la valoración fisioterapeutica presenta dolor en maleolo externo de 7/10 al movimiento de inversión del pie, de 7/10 a la palpación y de 5/10 al reposo. Se palpan espasmos en tibial anterior derecho y gastrocnemios bilateral, se evidencia edema en maleolo derecho respecto al izquierdo,  la movilidad articular en cuello de pie e encuentra conservada. Presenta patrones de movimientos buenos para miembro inferior derecho y normales para miembro inferior izquierdo, se observa alteración de la propiocepcion y el balance teniendo en apoyo unipodal derecho 18seg e izquierdo 26seg.  Lo anterior no limita su funcionalidad pero si restringe su participacion en su rol deportivo.','- Crioterapia, masaje con hielo durante 5 minutos.\r\n-Tens, nivel sensitivo.\r\n-Masaje de drenaje y sedativo.\r\n-Ejercicios de fortalecimiento con resistencia externa y manual.\r\n-Ejercicios de propiocepcion y balance en colchoneta y bosu.\r\n-Alcances anteriores con balon y cono.\r\n-Ejercicios en Trx.\r\n-Marcha en punta de pies y sobre talones en superficie inestable (colchoneta).\r\n-Sentadillas con Balon de bobath.\r\n-Fortalecimientos de evertores con balón de peso\r\n','Inestabilidad de tobillo derecho por esguince antiguo','2017-03-27','A la revaloracion la paciente presenta dolor en maleolo externo de 3/10 al movimiento de inversión del pie, de 4/10 a la palpación y de 0/10 al reposo. Se disminuyeron espasmos en tibial anterior derecho y persisten en gastrocnemios bilateral, no se evidencia  edema en maleolo derecho y se observa mejora en la propiocepcion y el balance teniendo en apoyo unipodal derecho 41seg e izquierdo 50seg. Demás evaluaciones se encuentran iguales y no se encuentra limitada su funcionalidad pero si restringe su participacion en su rol deportivo.',3),(12,47,'2017-04-03 08:55:42','Dr.  Jaime Villamizar ',10,'2017-03-29','Paciente de genero masculino que ingresa al servicio de fisioterapia realizando marcha antalgica con bastón tradicional. Presenta dolor en rodilla derecha de 5/10 al reposo 2/10 a la palpación y de 8/10 al movimiento de flexo-extensión de rodilla. A la evaluación de la perimetría se corrobora edema de 4cm en rodilla derecha respecto a la izquierda y atrofia generalizada de 1cm  en muslo y pierna derecha. Se observa disminución del rango de movimiento de rodilla de -20° de extensión y de 20°- 120° de flexión con sensación final elástico, para la dorsiflexion de 0-15° y pantiflexión de 0-30° por presencia de edema ademas disminución de la longitud muscular en recto anterior del cuadriceps, isquiotibiales y tensor de la fascia lata de manera bilateral. presenta patrones de movimiento buenos para miembro inferior izquierdo y malos para miembro inferior derecho por disminución generalizada de la fuerza. Lo anterior lo limita en actividades de desplazamientos por trechos cortos, ademas de actividades de ascenso y descenso de escaleras y restringe su rol personal.','Crioterapia, Masaje con hielo durante 7 minutos\r\nTermoterapia, paquete caliente durante 10 minutos\r\nTens, nivel sensitivo durante 10 minutos.\r\nTFNP, sostener relajar para isquiotibiales y recto anterior del cuadriceps.\r\nisometricas alternas y estabilización ritmica en posicion de puente.\r\nEjercicios en cadena cinetica cerrada.\r\nEjercicios activos para flexo-extension de cadera y rodilla.\r\nEjercicios con balón de bobath.','artritis reumatoide.','2017-04-11','En la revaloracion fisioterapeutica  Presenta dolor en rodilla derecha de 2/10 al reposo 0/10 a la palpación y de 6/10 al movimiento de flexo-extensión de rodilla. El edema disminuyó siendo ahora de 2cm en rodilla derecha respecto a la izquierda y atrofia generalizada de 1cm  en muslo y pierna derecha. Se conservó la disminución del rango de movimiento de rodilla de -20° de extensión y de 20°- 120° de flexión con sensación final elástico, para la dorsiflexion de 0-15° y pantiflexión de 0-30° por presencia de edema ademas disminución de la longitud muscular en recto anterior del cuadriceps, isquiotibiales y tensor de la fascia lata de manera bilateral. presenta patrones de movimiento bueno para miembro inferior izquierdo y regular para miembro inferior derecho por disminución generalizada de la fuerza. Lo anterior lo limita en actividades de desplazamientos por trechos cortos, ademas de actividades de ascenso y descenso de escaleras y restringe su rol personal.',3),(13,50,'2017-04-03 09:16:17','Dr. Juan Camilo Mantilla',10,'2017-03-31','Paciente de genero masculino que ingresa al servicio de fisioterapia de manera independiente realizando marcha antalgica. A la evaluación fisioterapeutica presenta dolor en talón y planta del pie derecho de 1/10 al reposo, de 4/10 a la palpación y de 6/10 movimiento de plantiflexión y dorsiflexión. Se palpan espasmos en musculo tibial anterior derecho y  gastrocnemio de forma bilateral ademas de edema de 1,2 cm de diferencia en talón derecho respecto al talón izquierdo. No se observa disminución del rango de movimiento, sin embargo presenta retracciones musculares en gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. presenta patrones de movimiento normales para miembro inferior izquierdo y regulares para miembro inferior derecho. Lo anterior no limita su funcionalidad pero si restringe su rol deportivo y recreativo.','Crioterapia. Masaje con hielo durante 10 minutos.\r\nTermoterapia, paquete caliente durante 10 minutos\r\nTens, nivel sensitivo. durante 10 minutos.\r\nMasaje de drenaje y sedativo. \r\nsostener relajar para isquiotibiales y recto anterior del cuadriceps.\r\nEstiramiento mantenido para gastrocnemios y musculatura plantar.\r\nRecomendaciones verbales sobre la importancia del reposo y pausa en sus actividades deportivas.\r\n','Espondilitis calcanea derecha.','2017-04-26',' A la revaloracion fisioterapeutica presenta dolor en talón y planta del pie derecho de 1/10 al reposo, de 1/10 a la palpación y de 1/10 movimiento de plantiflexión y dorsiflexión. Se palpa disminucion espasmos en musculo tibial anterior derecho y  gastrocnemio de forma bilateral ademas de disminucion edema de 0.5cm de diferencia en talón derecho respecto al talón izquierdo. Se valora mejoría en la longitud muscular en  gastrocnemios, isquiotibiales y recto anterior del cuadriceps bilateral. Presenta patrones de movimiento normales para miembro inferior izquierdo y buenos para miembro inferior derecho. Lo anterior no limita su funcionalidad ni restringe su rol deportivo y recreativo',3),(14,51,'2017-04-10 09:37:21','Dr. Fidel Vasquez',5,'2017-04-06','Paciente de genero femenino quien ingresa al servicio de fisioterapia realizando marcha de forma independiente. A  la valoración fisioterapeutica presenta dolor en zona cervical de 8/10 para todos los movimientos de cabeza y cuello, de 6/10 a la palpación y de 5/10 al reposo que le irradia a miembros superiores. Se palpan espasmos en músculos trapecio fibras superiores bilateral y se observa disminución del rango de movimiento para las rotaciones de cabeza de 0-30° hacia la izquierda y para la extensión de cabeza de 0-40°. Presenta patrones de movimiento regulares para cabeza y cuello por disminución del rango de movimiento y fuerza. Presenta limitación en las actividades básicas cotidianas y restricción en su rol laboral.','Crioterapia, masaje con hielo.\r\nTens nivel sensitivo.\r\nUltrasonido continuo de 1Hz.\r\nTermoterapia, paquete caliente.\r\nMasaje sedativo.\r\nSostener relajar.\r\nEstiramiento Mantenido','Discopatia de C4-C5 y C5-C6\r\nRectificación de la columna cervical','2017-04-17','En la  revaloración fisioterapeutica presenta dolor en zona cervical de 7/10 para todos los movimientos de cabeza y cuello, de 4/10 a la palpación y de 3/10 al reposo que le irradia a miembros superiores. Se palpa disminución de espasmos en músculos trapecio fibras superiores bilateral y se observa mejora del rango de movimiento para las rotaciones de cabeza de 0-40° hacia la izquierda. Presenta patrones de movimiento regulares para cabeza y cuello por disminución del rango de movimiento y fuerza. Presenta limitación en las actividades básicas cotidianas y restricción en su rol laboral.',3),(15,55,'2017-04-26 07:40:32','Dr. Juan Camilo Mantilla',NULL,'2017-04-25','paciente de genero masculino, quien ingresa realizando marcha de manera independiente. A la valoracion fisioterapeutica, se observa tendencia de pie cavo bilateral. Presenta dolor de 8/10 al reposo, de 7/10 a la palpación y de 10/10 al movimiento de subir y bajar escaleras. se observa edema en pie derecho respecto al pie izquierdo, retracciones musculares de plantiflexores y presencia de espasmos en la misma musculatura y planta del pie derecho. presenta disminución del rango de movimiento para la dorsiflexion del pie derecho de 0-10° con sensación final dura patológica. presenta patrones de movimientos buenos para miembros inferiores. Lo anterior no limita su funcionalidad, pero si presenta restricción en la participacion de su rol deportivo. ','Crioterapia, masaje con hielo\r\nTens nivel sensitivo\r\nMasaje de drenaje y sedativo.\r\nEstiramiento mantenido.\r\nTFNP, sostener relajar, isometricas alternas y estabilizacion ritmica.','Tendencia al retropie cavo\r\nOs navicular tipo II, con leve edema en la médula osea navicular, por contusión o incipientes cambios degenerativos.\r\nLesión osteocondral distal del metatarsiano del hallux de origen traumatico o degenerativo. \r\nLeve engrosamiento de la fascia plantar en la inserción por fascitis con cambios inflamatorios profundos e incipiente ruptura lineal intrasustancia de 5mm.\r\ntendinopatia inframaleolar del peroneo corto.','1969-12-31',NULL,3),(16,53,'2017-04-27 18:42:01','DR. Jhon Freddy Fonseca',10,'2017-04-17','Paciente de genero masculino en buenas condiciones. A la valoración fisioterapeutica presenta dolor de 8/10 al reposo y de 9/10 al movimiento de flexión, extensión abducción de cadera izquierda, no se valora dolor a la palpación, ni a los demás movimientos de cadera. A la evaluación del tejido tegumentario presenta herida quirúrgica suturada de 12cm de extensión en cara lateral de cadera izquierda sin signos de infección, ademas se observa gran edema y hematomas. Se observa disminución del rango de movimiento en cadera izquierda para la flexión de 0-80°, para la extensión de 0-5°, para la abducción de 0-45 con sensación final vacío, ademas disminución de la fuerza en abductores de 3-, extensores 2, flexores 3-,  isquiotibiales 3+ y cuadriceps 3+. Presenta patrones de movimiento normales para miembro inferior derecho y malos para miembro inferior izquierdo, realiza marcha en tres puntos correctamente. todo lo anterior le limita su funcionalidad en actividades básicas cotidianas y restringe su participación en todos sus roles.','Crioterapia, masaje con hielo.\r\nTens nivel sensitivo.\r\nMasaje sedativo y de drenaje.\r\nEjercicios de rango de movimiento asistidos para flexión, extensión y abducción de cadera.\r\nEjercicios de rango de movimiento activos y resistidos para cuadriceps e isquiotibiales.\r\nEjercicios resistidos con theraband para dorsiflexores y plantiflexores.\r\n','Artroscopia de cadera izquierda con implantación de expansor ','2017-04-28','A la revaloración fisioterapeutica presenta dolor de 4/10 al reposo, de 5/10 a la palpación y de 8/10 al movimiento de flexión, extensión abducción de cadera izquierda, aun no se valora dolor a los demás movimientos de cadera. A la evaluación del tejido tegumentario presenta herida quirúrgica sin suturas de 12cm de extensión en cara lateral de cadera izquierda en buen estado de cricartrizacion, ademas se observa disminución del edema y hematomas. presenta mejoras disminución de la fuerza en abductores de cadera con notas de 3,  y extensores con notas de 2+. Presenta patrones de movimiento normales para miembro inferior derecho y malos para miembro inferior izquierdo, realiza marcha en tres puntos correctamente. todo lo anterior le limita su funcionalidad en actividades básicas cotidianas y restringe su participación en todos sus roles.',3),(17,57,'2017-05-02 10:45:09','Dr. Juan Camilo Mantilla',7,'2017-04-26','Paciente de genero femenino, quien ingresa al servicio de fisioterapia en silla de ruedas acompañada de familiar. A la valoración inicial presenta dolor en la planta y en cara medial del pie izquierdo de 6/10 al reposo de 7/10 a la palpación y de 9/10 al movimiento de plantiflexión y dorsiflexión. Por medio de perimetría se corrobora edema en pie y tobillo izquierdo de 1cm respecto al derecho y leve edema en hallux, se palpan espasmos en tibial anterior y gastrocnemios aunque no se evidencia disminución del rango de movimiento. Presenta patrones de movimiento normales para miembro inferior derecho y malos para el miembro inferior izquierdo por compromiso de la fuerza, movilidad, funcionalidad y coordinación. lo anterior limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol laboral y recreativo.','Crioterapia, masaje con hielo,\r\nTermoterapia, paquete caliente\r\nTENS, nivel sensitivo\r\nUltrasonido pulsado de 1Hz de intensidad\r\nMasaje de drenaje y sedativo\r\nTFNP, como isométricas alternas y estabilización ritmicas en cuello de pie.\r\nReeducación de la marcha  en banda sin fin.\r\nReeducación de propiocepción en colchoneta ','Tendinosis distal del aquiles\r\nFascitis plantar\r\nTenosinovistis del flexor del hallux\r\nSindrome de pinzamiento posterior\r\nsinovitis de la articulacion tibio-astragalina, astragalo navicular y calcaneo cuboidea\r\n','2017-05-23','A la evaluación final presenta dolor en cara dorsal del pie izquierdo de 4/10 al reposo de 4/10 a la palpación  y de 2/10 al movimiento de plantiflexión y dorsiflexión. No presenta edema en pie ni tobillo izquierdo, se palpa disminución de espasmos en tibial anterior y gastrocnemios. Se observa alteración en las fases, subfases y determinates de la marcha. Presenta patrones de movimiento normales para miembro inferior derecho y miembro inferior izquierdo, aunque presenta retracciones bilaterales moderadas en musculatura de isquiotibiales, aun persiste alteración de propiocepción y coordinación. Lo anterior no limita su funcionalidad ni participación en su rol laboral y recreativo.\r\nNota: el día 22 de Mayo de 2017 la paciente manifiesta haber asistido a cita con \"sobandero\".\r\nNo realizo las terapias de manera continua y solo llevo a cabo 7 de las 15 sesiones solicitadas ',4),(22,60,'2017-05-10 21:13:18','Juan Camilo Mantilla',15,'2017-05-09','paciente de 27 años de edad con diagnostico ya mencionado, con 3 meses de evolución, con antecedentes de lesión similar previa hace 6 meses, pie plano e hiperextensión de rodillas.de  Escala análoga del dolor: 2/10 al reposo, 8/10  al movimiento, 8/10 a la presión submaleolar externa y dorso de los metatarsos, maléolo externo borrado por edema, marcha antálgica con cojera izquierda, edema de cuello de pie de 2 cm de diámetro con respecto a maléolo contralateral, flexión plantar de 12°, flexión dorsal de 20°, inversión 5° y eversión 12°, disminución de fuerza muscular en evertores por el edema.','crioterapia, ultrasonido, paquete caliente, drenaje linfático, masaje, estiramiento, ejercicios bipodal en piso, colchoneta, step y trampolín,  ejercicios de propiocepción sobre bases inestable en trampolín, bosu ball, ejercicios de coordinación con escalera y rehabilitación de la marcha sobre banda sin fin, fortalecimiento con TRX y thera band e isométricos.','Pinzamiento lateral de tobillo','2017-06-01','Paciente que finaliza sus 15 sesiones de fisioterapia. Escala análoga del dolor 2/10 al reposo, 4/10 al movimiento activo, 3/10 a la presión en el tendón tibial anterior , 7/10 a la palpación supramaleolar externa, 5/10 submaleolar externa, sin edema, con marcha sin antalgia, flexión plantar 20°, flexión dorsal 33°, inversión 33°, eversión 32°, fuerza muscular de 5/5. No le impide el rol en sus actividades laborales ni de la vida diaria (caminar, trotar) y se le restringe practicar el patinaje por aparición del dolor a la activad extenuante.',5),(23,61,'2017-05-22 08:48:42','Dr. Juan Camilo Mantilla',7,'2017-05-10','Paciente masculino de 35 años de edad, quien llega al consultorio en muletas sin hacer apoyo de pie derecho, el cual porta bota inmovilizadora  por presentar un esguince de tobillo derecho hace 16 días de evolución, a valoración refiere dolor de 2/10 a palpación al rededor de maléolo derecho, 6/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema moderado al rededor de la articulación tibioperoneoastragalina  derecho, se corrobora con perimetría registrando  1,5 cm, atrofia muscular de gastrosoleo derecho, disminución de rangos de movilidad activa a la dorsiflexión de 15°, plantiflexión 25°, inversión de 10°, eversión de 5°, buena fuerza muscular en plantiflexores, dorsiflexores y regular fuerza en evertores e invertores. En Postura vista lateral presenta hiperextensión de rodilla, descenso del arco plantar en apoyo. marcha antalgica sin muletas, con alteración en la fases de marcha, alteración en la coordinación y propiocepción en miembros inferiores, registrando 5 segundos en equilibrio unipodal derecho.  lo anterior limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol laboral y recreativo.','Criomasaje: Masaje cubo de hielo\r\nUltrasonido, pulsátil y continuo\r\nTENS, \r\nTermoterapia: Paquete caliente \r\nMasaje de drenaje y sedación \r\nEntrenamiento de marcha sobre colchoneta, step y banda sin fin, \r\nEntrenamiento funcional para equilibrio y postura en trampolín y bosú, con sus progresiones y alcances laterales y frontales\r\nEntrenamiento con TRX. \r\nUso de Therabands, escalerilla, ','Esguince de tobillo derecho','2017-05-18','Paciente que realiza 7 sesiones de terapia física, quien no continúa, por motivo de viaje al exterior, se realiza valoración final, presentando dolor de 2/10 al movimiento activo de inversión y eversión del pie derecho, presenta edema leve al rededor de la articulación tibioperoneoastragalina  derecho de 0,5 cm, leve disminución de rangos de movilidad activa a la  inversión de 20° y eversión de 10°, , buena fuerza muscular en plantiflexores, dorsiflexores y buena fuerza en evertores e invertores, marcha sin alteración de sus fases, mejoro coordinación y propiocepción en miembros inferiores, registro  aumento a 40 segundos en equilibrio unipodal derecho.  Lo anterior no limita su funcionalidad en actividades de desplazamiento y restringe su participación en su rol laboral. ',4),(24,69,'2017-06-09 11:43:26','Particular',5,'2017-06-07','Paciente de 52 años de edad, que ingresa al servicio de fisioterapia de manera independiente, con dolor en la región cervical y cintura escapular.  Escala análoga de dolor de 7/10 al reposo en la nuca que se extiende a la base del cráneo y a la musculatura escapular posterior, 8/10 a la palpación en trapecio fibras superiores, elevador de la escápula,supraespinoso,esternocleidomastoideo, espasmos en trapecios fibras superiores, supraespinoso y esternocleidomastoideo. Dificultando sus actividades de la vida diaria (trabajo), y sus actividades lúdico recreativas (nadar) por dolor.','Crioterapia, ultrasonido, TENS, paquete caliente, masaje terapeutico, estiramiento pasivo y autoestiramiento con Stoot pilates.','Cervicalgia ','2017-06-15','Finalizadas 5 sesiones de fisioterapia se encuentra que el dolor  disminuyo levemente a 5/10 según EAV a la palpación de trapecio superior y medio, supraespinoso y esternocleidomastoideo bilateral. Disminuyeron levemente los espasmos en dichos músculos. Manifiesta que el dolor se aumenta en su puesto de trabajo ya que permanece varias horas seguidas frente al computador. Se dieron recomendaciones de cambios en el puesto de trabajo, ejercicios para las  pausas activas y ejercicios en agua.   ',5),(25,71,'2017-07-19 18:21:13','Dr Juan Camilo Mantilla',NULL,'2017-07-04','Recibo paciente de 30 años quien sube caída de 8 meses de evolución, de una altura de 1 metro y como resultado luxofractura metatarsiana y de cuñas de pie derecho.\r\nPresenta: dolor 7/10 al caminar o permanecer largo tiempo de pie ubicado en cuello de pie, zona dorsal y fascia platar.\r\narcos movilidad; dorsiflexión 15 grados, platiflexión 40, inversión 40, eversión 30, flexión de dedos disminuida,\r\ncircunferencia del pie comparativa: edema de 1.5 cm en antepie derecho, 2.5 cm zona medial del pie y 1 cm a nivel de tobillo.\r\nrealiza marha antálgica con alteración en la fase de apoyo plantar y despegue de los dedos',NULL,'Fractura metatarsianos y cuñas pie derecho','1969-12-31',NULL,2);

/*Table structure for table `cliente_sub_paquete` */

DROP TABLE IF EXISTS `cliente_sub_paquete`;

CREATE TABLE `cliente_sub_paquete` (
  `id_cliente_sub_paquete` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Id del sub paquete cliente',
  `id_cliente` int(11) unsigned NOT NULL COMMENT 'Id del cliente',
  `id_sub_paquete` int(11) unsigned NOT NULL COMMENT 'Id del sub paquete',
  `fecha_inicio` datetime NOT NULL COMMENT 'fecha de inicio',
  `estado` smallint(1) NOT NULL DEFAULT '1' COMMENT 'estado',
  `fecha_pago` date DEFAULT NULL COMMENT 'fecha de pago',
  `descuento` double(10,2) DEFAULT NULL COMMENT 'descuento realizado',
  `total_pagar` double(10,2) DEFAULT NULL COMMENT 'total a pagar',
  `fecha_modificacion` date DEFAULT NULL COMMENT 'fecha modificacion',
  `numero_excusas` smallint(2) NOT NULL DEFAULT '0' COMMENT 'numero de excusas usadas',
  `fecha_limite` date NOT NULL COMMENT 'fecha limite modificacion',
  PRIMARY KEY (`id_cliente_sub_paquete`),
  KEY `id_cliente_cliente_sub_paquete_idx` (`id_cliente`),
  KEY `id_sub_paquete_cliente_sub_paquete_idx` (`id_sub_paquete`),
  CONSTRAINT `id_cliente_cliente_sub_paquete_fk` FOREIGN KEY (`id_cliente`) REFERENCES `cliente` (`id_cliente`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `id_sub_paquete_cliente_sub_paquete_fk` FOREIGN KEY (`id_sub_paquete`) REFERENCES `sub_paquete` (`id_sub_paquete`) ON DELETE NO ACTION ON UPDATE NO ACTION
